import './App.css';
import React, {useEffect, useState} from 'react';
import Annotations from './components/Annotation';

function App() {
  var [data, setData] = useState(null);
  useEffect(() => {
    fetch("http://localhost:7777/api/124124331124")
      .then((res) => res.json())
      .then((info) => {
        setData(info) ;
      })
        .catch((error) => console.log(error.message));  
      }, []);


  return (
    <div className="App">
    <header className="App-header">
        {!data ? (
          <div><Annotations /></div>
        ) : (
          <table class="page-table">
            <tr>
              <th style={{width:"75%"}} class="presentation-title"><h1>{data.slides[0].text}</h1></th>
              <th style={{width:"25%"}}>ola</th>
            </tr>
            <tr>
              <td class="slideshow-container">
                <pre>
                  <div class='code fade' id={data?.slides[0].idSlide} name={data.slides[0].text} dangerouslySetInnerHTML={{ __html: data.slides[0].code }}/>
                </pre>
              </td>
              <td class="annotations-container">
                <div class="annotations">
                  <ul>
                    {data.variables.map((variable,index) => {
                      let content = ""
                      if(variable.category === "variable"){
                        content= (
                          <li>
                            <div class="new-ano-container">
                              <div class="ano-circle">
                                {index+1}
                              </div>
                              <div class="ano-box">
                                <span class={variable.command}>
                                  {variable.text}
                                </span>
                              </div>
                            </div>
                          </li>
                        )}
                      return content;
                      })}
                  </ul>
                </div>
              </td>
            </tr>
            <tr>
              <td class="navigation-container">
                <table style={{width:"100%"}}>
                  <tr style={{display:"flex"}}>
                    <td class="left"><a class="prev" onClick="plusSlides(-1)" href="http://localhost:3000">Previous</a></td>
                    <td class="middle" nota="InsertNavGraph">
                      <div class="graph-container">
                        <svg width="200" height="100" class="graph">
                          <circle cx="20" cy="20" r="5" class="dot" id="dot1" stroke=""></circle>
                          <circle cx="50" cy="50" r="5" class="dot" id="dot2"></circle>
                          <circle cx="80" cy="20" r="5" class="dot" id="dot3"></circle>
                          <line x1="20" y1="20" x2="50" y2="50" stroke="black" />
                          <line x1="50" y1="50" x2="80" y2="20" stroke="black" />
                          <line x1="80" y1="20" x2="120" y2="50" stroke="black" />
                        </svg>
                      </div>
                    </td>
                    <td class="right"><a class="next" onClick="plusSlides(1)"  href="http://localhost:3000">Next</a></td>
                  </tr>
                </table>
              </td>
              <td></td>
            </tr>
          </table>
        )}
      </header>
    </div>
  );
}

export default App;
